import Grid from '@material-ui/core/Grid';
import React from 'react';
import DashboardV from './src/Dashboard';
import HeaderV from './src/Header';
import LineChartV from './src/LineChart';
import RadarChartV from './src/RadarChart';

function App() {
  return (
    <div  style={{backgroundColor:'#eee'}}>

      <HeaderV/>

      <Grid container >
        <Grid>
        <Grid item xs={12} sm={9} md={6} >
        <DashboardV/>
        </Grid>
        </Grid>

        <Grid>
        <Grid item xs={12}  md={6}  style={{width:'1000px',backgroundColor:'white',margin:'20px'}}>
      <LineChartV/>
      </Grid>

      <Grid item xs={12}  md={6}  style={{width:'1000px',backgroundColor:'white',margin:'20px'}}>
       <RadarChartV/>
     </Grid>

     <Grid item xs={12}  md={6}  style={{width:'600px',backgroundColor:'white',margin:'20px'}}>
      <LineChartV/>
      </Grid>


      <Grid item xs={12}  md={6}  style={{width:'600px',backgroundColor:'white',margin:'20px'}}>
      <LineChartV/>
      </Grid>
      </Grid>


          </Grid>

</div>


  );
}

export default App;
